### Find all occurrences of a pattern in a string ###
def PatternOccurrence(pattern,genome):
    index = 0
    indexList = []
    for i in range(len(genome)-len(pattern)+1):
        if genome[i:i+len(pattern)] == pattern:
            indexList.append(index)
        index += 1
    return indexList

pattern = 'TGCGTGGTG'
genome = ''
# print(PatternOccurrence(pattern,genome))

patternIndices = PatternOccurrence(pattern,genome)
answer = ''
for index in patternIndices:
    answer += str(index) + ' '
answer = answer[:-1]
print(answer)